import React, { useState, useEffect } from "react";
import { Container, Row, Col } from "react-bootstrap";
import Button from "react-bootstrap/Button";
import Particle from "../Particle";
import Resumecontent from "./ResumeContent";
import axios from "axios";
import pdf from "../../Assets/Soumyajit-Behera.pdf";
import { AiOutlineDownload } from "react-icons/ai";

function Resume() {
  const uri = "https://porfolio-backend.vercel.app/ranks/getRanks";
  const [spojRank, upadteSpojRank] = useState(0);
  const [hackerrank, upadteHackerank] = useState(0);
  const [sem, upadateSem] = useState(0);
  const [cgpa, upadteCgpa] = useState(0);

  useEffect(() => {
    axios
      .get(uri)
      .then((res) => {
        upadteSpojRank(res.data.message[0].spojRank);
        upadteHackerank(res.data.message[1].hackerrank);
        upadteCgpa(res.data.message[2].cgpa);
        upadateSem(res.data.message[3].sem);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <Container fluid className="resume-section">
      <Particle />
      <Container>
        <Row style={{ justifyContent: "center", position: "relative" }}>
          <Button variant="primary" href={pdf} target="_blank">
            <AiOutlineDownload />
            &nbsp;Download CV
          </Button>
        </Row>
        <Row className="resume">
          <Col md={6} className="resume-left">
            <h3 className="resume-title">Experience</h3>
            <Resumecontent
              title="SURP Research Internship []"
              date="April 2021 - Present"
              content={[
                "Constructing Latent Dirichlet Allocation model to perform topic modeling out of the review contents of the scrapped data from IOS and Android stores",
              ]}
            />
            <Resumecontent
              title="Research Internship [Indiana University, Bloomington]"
              date="April 2021 - Present"
              content={[
                "Constructing Latent Dirichlet Allocation model to perform topic modeling out of the review contents of the scrapped data from IOS and Android stores",
              ]}
            />
            <Resumecontent
              title="Machine Learning Internship [Idfy, Baldor, Mumbai]"
              date="June 2020 - August 2020"
              content={[
                "Worked on incorporating the improvements in the existing Document OCR Detection models in Golang",
                "Reviewed ResNet, VGG16, EfficientNet, Inception model to employ binary image classifiers for ID documents",
              ]}
            />
            <h3 className="resume-title">Positions of Responsibility</h3>
            <Resumecontent
              title="Student Risk Committee Member [Institute of Risk Management [UK] - India Affiliate]"
              content={[
                "Worked on creating the frontend-end of the website using Bootstrap, Javascript.",
              ]}
            />
            <Resumecontent
              title="Lead, Women Who Code, Mumbai Chapter"
              content={[
                "Operated on developing the frontend end of the website using Bootstrap, Javascript and backend APIs using Node.js",
              ]}
            />
            <Resumecontent
              title="Ambassador, Women in Entrepreneurship DSSE, IIT Bombay"
              content={[
                "Operated on developing the frontend end of the website using Bootstrap, Javascript and backend APIs using Node.js",
              ]}
            />
            <Resumecontent
              title="Class Representative Computer Science & Engineering Dept"
              content={[
                "Operated on developing the frontend end of the website using Bootstrap, Javascript and backend APIs using Node.js",
              ]}
            />
          </Col>
          <Col md={6} className="resume-right">
            <h3 className="resume-title">Education</h3>
            <Resumecontent
              title="Computer Science & Engineering [IIT Bombay]"
              date="2019 - Present"
              content={[`CGPA: ${cgpa}`]}
            />
            <Resumecontent
              title="Intermediate/+2 [Delhi Public School, Panipat City]"
              date="2019"
              content={["Precentage: 96.8%"]}
            />
            <Resumecontent
              title="Matriculation [Delhi Public School, Panipat City]"
              date="2017"
              content={["CGPA: 10.0"]}
            />
            <h3 className="resume-title">Ranks and Achivements</h3>
            <Resumecontent
              title=""
              content={[
                `Current rank in Spoj ${spojRank}`,
                `Current rank in HackerRank  ${hackerrank}`,
                "Top Performer in Code-Break 1.0",
                "Participant in Hack-A-Bit 2019",
              ]}
            />
          </Col>
        </Row>
      </Container>
    </Container>
  );
}

export default Resume;
